  [],\n\t\"revision_timestamp\": \"2016-01-07T22:11:43.397385\",\n\t\"name\": \"indonesia-community-based-health-and-nutrition-to-reduce-stunting-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" n        The evaluation of the Nutrition
  Project will address three key research questions, which focus on both impacts and
  implementation. (1) What is the impact of the Nutrition Project's package of supply
  and demand-side activities on key outcomes? (2) What is the impact of the Nutrition
  Project on key subgroups, such as those defined by socioeconomic status? (3) How
  were various components of the Nutrition Project implemented? We will also seek,
  to the extent possible, to provide evidence on which specific project activities
  in the package were most likely to have led to the measured impacts and how they
  did so.n    nTo answer these questions, Mathematica will implement a mixed-methods
  evaluation, with the quantitative component using a random assignment design. This
  design enables us to rigorously answer the first two research questions related
  to project impacts by analyzing quantitative data on both short- and medium-term
  outcomes. The baseline quantitative data presented in this package was collected
  in late 2014 and early 2015, and endline data collection is expected in late 2017
  or late 2018, depending on the progress of implementation. nnWe will complement
  this quantitative analysis with qualitative analysis, mainly related to implementation,
  in order to answer the third research question. We expect the implementation analysis
  to take place in late 2015 or early 2016.n      \",\n\t\"license_title\": \"License
